#!/usr/bin/env node

const fs = require('fs');
const path = require('path');

// Path to the broken cli.js file
const cliPath = '/opt/homebrew/lib/node_modules/@anthropic-ai/claude-code/cli.js';

console.log('Reading cli.js file...');
let content = fs.readFileSync(cliPath, 'utf8');

// Replace all Unicode escape sequences with actual Unicode characters
// This regex matches \u followed by 4 hex digits
const originalContent = content;
content = content.replace(/\\u([0-9a-fA-F]{4})/g, (match, hex) => {
  return String.fromCharCode(parseInt(hex, 16));
});

if (content === originalContent) {
  console.log('No Unicode escapes found to fix.');
  process.exit(0);
}

console.log('Writing fixed cli.js file...');
fs.writeFileSync(cliPath, content, 'utf8');

console.log('✓ Successfully fixed Unicode escapes in cli.js');
console.log('\nTesting Claude Code...');

const { execSync } = require('child_process');
try {
  const version = execSync('claude --version', { encoding: 'utf8' });
  console.log('✓ Claude Code is working!');
  console.log(`Version: ${version.trim()}`);
} catch (error) {
  console.error('✗ Claude Code still has errors:');
  console.error(error.message);
  process.exit(1);
}

