];

/**
 * Send test request to proxy
 */
async function sendProxyRequest(modelId: string, messages: any[], tools?: any[]): Promise<any> {
  return new Promise((resolve, reject) => {
    const body = JSON.stringify({
      model: modelId,
      messages: messages,
      tools: tools,
      max_tokens: 1000,
      temperature: 0.7,
    });

    const req = http.request(
      `${PROXY_URL}/v1/messages`,
      {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'anthropic-version': '2023-06-01',
          'x-api-key': 'test-key',
        },
      },
      (res) => {
        let data = '';
        res.on('data', (chunk) => (data += chunk));
        res.on('end', () => {
          try {
            resolve(JSON.parse(data));
          } catch (error) {
            reject(new Error(`Failed to parse response: ${data}`));
          }
        });
      }
    );

    req.on('error', reject);
    req.write(body);
    req.end();
  });
}

/**
 * Check if proxy is running
 */
async function isProxyRunning(): Promise<boolean> {
  return new Promise((resolve) => {
    const req = http.get(`${PROXY_URL}/v1/models`, (res) => {
      resolve(res.statusCode === 200);
    });
    req.on('error', () => resolve(false));
    req.setTimeout(5000, () => {
      req.destroy();
      resolve(false);
    });
  });
}

